      SELECT ALL - col0 col1 FROM tab1 (FORMAT parquet) WHERE NOT + - col1 / + + col0 BETWEEN - CAST ( NULL AS REAL ) AND - + ( + col1 ) + - - col2;
  - name: tab1

outputs:
  - name: q13859.out
    data: |
